import React, { useEffect } from 'react';
import { listsongs } from '../json/songs';

function SongList() {

    const { songs } = listsongs;
    console.log(songs)
    return (
        <div>
            <h3>Songs List</h3>
            {
                songs.map(song => (
                    <div>{song.year}</div>
                )).sort((song1,song2)=>song1.year-song2.year)
            }
        </div>
    )
}

export default SongList;
